INSERT INTO `companies` VALUES (1,'OneSt Vo Van Ngan','2025-03-23 10:11:03','Trường Đại học Sư phạm Kỹ thuật TP. Hồ Chí Minh (HCMUTE) là một trong những trường đại học kỹ thuật hàng đầu tại Việt Nam, nổi bật trong đào tạo kỹ sư và giáo viên kỹ thuật. Trường được biết đến với chất lượng giảng dạy cao, hệ thống cơ sở vật chất hiện đại và các chương trình đào tạo tiên tiến, đáp ứng nhu cầu nhân lực chất lượng cao cho nền kinh tế và công nghiệp của đất nước.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNjsmIZ2NbOFioOhu0Ig2yL6MxR7RXtUIGHDDG6AOIjM-ZXBwIidp3NNhWnj84Ol0k_JY&usqp=CAU','2025-04-01 09:04:02','https://fit.hcmute.edu.vn/',3,'Số 1, Võ Văn Ngân, phường Linh Chiểu, thành phố Thủ Đức, TP.HCM'),(2,'TechNova Solutions','2025-03-23 16:27:25','SỨ MẠNG\n\n- Trường Đại học Công nghệ Thông tin là một trung tâm đào tạo đại học, sau đại học cung cấp nguồn nhân lực chất lượng cao, nhằm đáp ứng nhu cầu của thị trường lao động và phục vụ cộng đồng.\n\n- Trường Đại học Công nghệ Thông tin là một trung tâm hàng đầu về nghiên cứu khoa học và chuyển giao công nghệ về công nghệ thông tin – truyền thông và các lĩnh vực liên quan.\n\nTẦM NHÌN\n\nTrường Đại học Công nghệ Thông tin trở thành trường đại học uy tín về công nghệ thông tin – truyền thông và các lĩnh vực liên quan trong khu vực Châu Á.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQxVdWBNuFW1KSGFtKhRMmH0TubATVQ0UOW_PiNZlKaKMagyuCFzN09b9msjbRIM4cbnJE&usqp=CAU','2025-04-01 09:05:33','https://www.uit.edu.vn/',3,'Khu phố 6, P.Linh Trung, Tp.Thủ Đức, Tp.Hồ Chí Minh.'),(4,'CyberTech Innovators',NULL,'Trường Đại học chuyên đào tạo các ngành về kỹ thuật, giao thông, và vận tải tại Việt Nam.','https://inkythuatso.com/uploads/thumbnails/800/2021/12/logo-dai-hoc-giao-thong-van-tai-inkythuatso-01-23-16-23-19.jpg','2025-03-30 21:11:12','https://ut.edu.vn',3,'Số 2, Võ Oanh, Phường 25, Quận Bình Thạnh, TP.HCM'),(6,'TechNova Solutions','2025-04-19 19:15:44','TechNova Solutions is a global leader in software innovation, delivering cutting-edge cloud computing and enterprise applications to businesses worldwide. Our mission is to empower organizations with scalable and secure digital tools that drive transformation.','https://scontent.fsgn2-4.fna.fbcdn.net/v/t39.30808-1/261508997_3010573009216559_2402257009515793035_n.jpg?stp=dst-jpg_s200x200_tt6&_nc_cat=101&ccb=1-7&_nc_sid=2d3e12&_nc_eui2=AeFL9oQcvsoGPTANIZWEfBcfBPQAXx6MFPwE9ABfHowU_EHX6qv1cY9SOIlXIlJXBOIFMwxGpffhJplNpWcB2JcZ&_nc_ohc=oUB9VXIlhpkQ7kNvwHanQ2Z&_nc_oc=AdnXcPw5PmYkzmggQcv6NwwBo2-0FB4gDopThr5a_Go3S3YI7dA4GhmshfsyY6lPn-jyLJkS6QMi4yLEHpNNeZHj&_nc_zt=24&_nc_ht=scontent.fsgn2-4.fna&_nc_gid=skxsuq7kjOVF8NKDwQ3xEw&oh=00_AfEs2f7gODXyqdgvSVMiJl-leQL0nchptJGeGdBzzR1NLQ&oe=68095C7C','2025-04-19 19:15:44','http://technova.com',3,'221B Baker Street, London, UK'),(7,'GreenField Analytics','2025-04-19 19:15:44','GreenField Analytics specializes in environmental data science, offering machine learning and AI-based solutions to track and analyze climate trends across the globe.','https://cdn.haitrieu.com/wp-content/uploads/2021/09/Logo-DH-Kinh-Te-TpHCM-UEH.png','2025-04-19 19:15:44','http://greenfield.ai',3,'1600 Amphitheatre Parkway, Mountain View, CA, USA'),(8,'Skyline Robotics','2025-04-19 19:15:44','Skyline Robotics is at the forefront of robotic automation for skyscraper maintenance, combining AI, safety, and engineering excellence in one package.','https://cdn.haitrieu.com/wp-content/uploads/2021/09/Logo-DH-Bach-Khoa-HCMUT.png','2025-04-19 19:15:44','http://skylinerobotics.com',3,'5th Avenue, Manhattan, New York, NY, USA'),(9,'QuantumEdge Labs','2025-04-19 19:15:44','QuantumEdge Labs explores the edge of computation with quantum technologies, building next-generation processors and algorithms for real-time problem solving.','https://copyshop.vn/wp-content/uploads/2022/12/logo-truong-dai-hoc-cong-nghiep-tphcm.png','2025-04-19 19:15:44','http://quantumedge.io',3,'Schönhauser Allee 10, Berlin, Germany'),(10,'Aether BioTech','2025-04-19 19:15:44','Aether BioTech develops sustainable bioengineering products for healthcare and agriculture using advanced CRISPR and genetic modeling techniques.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTrOg5bhNAdrYbUd2NXTYkf4ZadqZnWsVajHA&s','2025-04-19 19:15:44','http://aetherbio.com',3,'Rue de Rivoli, Paris, France'),(11,'Oceanic Systems','2025-04-19 19:15:44','Oceanic Systems builds smart underwater sensors and communication platforms used in maritime security, marine research, and offshore energy.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQzLayitYZss5hVtvN5M2S_k5kgeuxbKvn6-Q&s','2025-04-19 19:15:44','http://oceanicsystems.co',3,'Circular Quay, Sydney, Australia'),(12,'Nordic FinTech Group','2025-04-19 19:15:44','Nordic FinTech Group creates secure and user-friendly digital banking platforms, offering solutions in blockchain, digital wallets, and real-time transactions.','https://hcmussh.edu.vn/img/dmDonVi/58315819.gif?t=58315820','2025-04-19 19:15:44','http://nordicfintech.com',3,'Vasagatan 7, Stockholm, Sweden'),(13,'Artemis Space Corp','2025-04-19 19:15:44','Artemis Space Corp is a private aerospace company building launch vehicles and satellite systems to support low Earth orbit missions and beyond.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRLWuzgOk9pRRisWTuKRiaTvpYyLQ9yxZvVNA&s','2025-04-19 19:15:44','http://artemisspace.com',3,'400 E Street SW, Washington, DC, USA'),(14,'Helios Energy Systems','2025-04-19 19:15:44','Helios Energy Systems provides renewable energy solutions, including solar panels and smart-grid infrastructure, to promote sustainable living globally.','https://inkythuatso.com/uploads/images/2021/12/logo-dai-hoc-luat-tphcm-inkythuatso-01-21-10-13-41.jpg','2025-04-19 19:15:44','http://heliosenergy.eu',3,'Piazza San Marco, Venice, Italy');
