INSERT INTO `jobs` VALUES (4,'We are seeking an experienced Senior Android Developer who is passionate about building high-quality mobile applications on the Android platform. As a Senior Android Developer, you will be responsible for designing, developing, and maintaining Android applications while collaborating closely with design, product, and other development teams to build and improve app features.Develop Android Applications: Design and build new Android applications, from UI to complex features.Optimize Performance: Improve the performance of Android applications, ensuring they run smoothly across a wide range of devices and Android versions.Integrate APIs and Services: Work with third-party APIs, web services, and backend integrations.Testing: Create and maintain automated tests to ensure app quality, detect bugs, and optimize code.Version Management: Ensure proper version control during development and release of app updates.Improve Development Process: Contribute to the software development processes within the team by providing creative ideas and improving workflows.We are seeking an experienced Senior Android Developer who is passionate about building high-quality mobile applications on the Android platform. As a Senior Android Developer, you will be responsible for designing, developing, and maintaining Android applications while collaborating closely with design, product, and other development teams to build and improve app features','Above 3 years','2025-04-28 16:59:59','FULL_TIME','Ho Chi Minh City, Viet Nam','2025-03-27 17:00:00','At least 3 years of experience in Android development. Familiar with MVVM, Retrofit, and Jetpack','30000$','Senior Android Developer',2),(5,'Phát triển và bảo trì hệ thống backend sử dụng Spring Boot','Non-requirement','2025-05-30 16:59:59','FULL_TIME','Ha Noi, Viet Nam','2025-03-29 17:00:00','Có kinh nghiệm với Java, Spring Boot và MySQL','10000$','Backend Developer',1),(7,'Join TechNova as a Software Engineer to develop scalable systems and innovative solutions for our global clients.','3 years','2025-06-18 12:26:18','FULL_TIME','221B Baker Street, London, UK','2025-04-19 12:26:18','At least 3 years of experience in Java development, Familiar with Spring Boot, REST APIs, Docker','$75,000 - $95,000','Software Engineer - TechNova',1),(8,'Work with GreenField Analytics to build responsive and modern UIs for climate data apps.','2 years','2025-06-18 12:26:18','FULL_TIME','1600 Amphitheatre Parkway, Mountain View, CA, USA','2025-04-19 12:26:18','2+ years of experience in ReactJS, Strong understanding of TypeScript, Experience with Figma and design systems','$65,000 - $85,000','Frontend Developer - GreenField',2),(9,'Analyze telemetry data from robotic systems and support machine learning development.','2 years','2025-06-18 12:26:18','PART_TIME','5th Avenue, Manhattan, NY, USA','2025-04-19 12:26:18','Experience with Python and Pandas, Strong SQL skills, Familiarity with machine learning basics','$70,000 - $90,000','Data Analyst - Skyline Robotics',4),(10,'Work on quantum machine learning algorithms and simulation tools.','3 years','2025-06-18 12:26:18','FULL_TIME','Schönhauser Allee 10, Berlin, Germany','2025-04-19 12:26:18','Python expertise, Knowledge of Qiskit or other quantum SDKs, Understanding of optimization algorithms','$95,000 - $120,000','AI Engineer - QuantumEdge',6),(11,'Conduct bio-genetic research for sustainable crop development using advanced tools. abc','2 years','2025-06-18 12:26:18','CONTRACT','Rue de Rivoli, Paris, France','2025-04-19 12:26:18','Masters in BioTech, Familiarity with CRISPR, Data analysis with Python or R','$80,000 - $100,000','Bio Researcher - Aether BioTech',7),(12,'Develop smart underwater sensors and embedded devices for maritime use.','3 years','2025-06-18 12:26:18','FULL_TIME','Circular Quay, Sydney, Australia','2025-04-19 12:26:18','Experience with C/C++, Understanding of IoT protocols, Prior work with marine environments','$85,000 - $110,000','Embedded Engineer - Oceanic Systems',8),(13,'Design and deploy secure smart contracts for modern digital banking apps.','2 years','2025-06-18 12:26:18','FULL_TIME','Vasagatan 7, Stockholm, Sweden','2025-04-19 12:26:18','Solid understanding of Solidity, Blockchain fundamentals, Experience with web3 and DeFi protocols','$90,000 - $115,000','Blockchain Developer - Nordic FinTech',9),(14,'Work on control systems for satellites and launch vehicles.','3 years','2025-06-18 12:26:18','FULL_TIME','400 E Street SW, Washington, DC, USA','2025-04-19 12:26:18','Experience with aerospace telemetry, Knowledge of control systems, Familiar with MATLAB/Simulink','$105,000 - $135,000','Aerospace Engineer - Artemis Space',10),(15,'Analyze energy usage and design optimization strategies for solar panel systems.','2 years','2025-06-18 12:26:18','PART_TIME','Piazza San Marco, Venice, Italy','2025-04-19 12:26:18','Experience with power system modeling, Familiar with energy analytics tools, Strong Excel skills','$70,000 - $90,000','Energy Analyst - Helios Energy',11),(17,'NovaMed AI is transforming diagnostics through artificial intelligence, offering image recognition systems that detect diseases earlier and more accurately.','3 years','2025-05-03 16:59:59','FULL_TIME','Bay Street, Toronto, Canada','2025-04-30 17:00:00','Build and evaluate deep learning models for medical imaging diagnostics.','10000$','NovaMed AI',1);
